function Main() {
  return (
    <div className="App">

      <div className="container-title">
        <div className='background-container'>

        </div>
        <h1 className='title'>

          Приветствую на моем сайте!
          Дипломная работа на тему "Портфолио".
          <div className='logo'>  <img src="/logo.png" alt="Your Logo" className="logo" /> </div>
        </h1>


      </div>

    </div>
  );
}

export default Main;
